import React from "react";
import Card from "../components/Card";
import "../css/Home.css";

const Home = ({ data }) => {
  console.log(data);
  return (
    <div className="home">
     {
      data.map((val,index)=>(
        <Card key={index} />
      ))
     }
    </div>
  );
};

export default Home;
